    data: |
      SELECT DISTINCT - - ( 64 ) + + col0 + col0 + + col1, - 89 AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q1619.out
    data: |
      207	-89
      269	-89
      281	-89
